import "./App.css";
import NavigationBar from "./components/NavigationBar";
import Header from "./components/Header";
import AboutSection from "./components/AboutSection";
import ProjectsSection from "./components/projectsSection";

function App() {
  return (
    <div className="App">
      <NavigationBar />
      <Header />
      <AboutSection />
      <ProjectsSection />
      <ProjectCard />
    </div>
  );
}

export default App;
